const ReduxDemo = () => { 
var storeData  = store.getState();
console.log(" Initail data in the store ")
console.log(storeData);
return (
 
        <div>Redux Demo
 
            Initial data from the store is:
            <ul>
                {storeData.map( 
                    (item, key) => <li key={key}> {item.name}  {item.age} {item.awards.join(",")} </li>
                     ) 
                }
            </ul>          
 <button onClick={addOnePlayer}>Add one player</button>;
 <button onClick={addTwoPlayer}>Add two player</button>
        </div>
)
}
 
export default ReduxDemo;
